import React from 'react';
import ReactDOM from 'react-dom';


const ToDoTitle = () =>{
    return  <h1> ToDoS</h1>
}
const ToDoSearch = ()=>{
    return <input type='text' placeholder="Input do wish" />
}

const ToDoHeader = () =>{
    return <header>
        <ToDoTitle/>
        <ToDoSearch/>
    </header>
}
const ToDoCompleted = () =>{
    return (
        <li>

        </li>
    )
}
const ToDoView = () =>{
    return (
        <li>

        </li>
    )
}
const ToDoEditing = () =>{
    return (
        <li>

        </li>
    )
}

const ToDoList = () =>{
    const item = ['first if null', 'second']
    return (
        <ul >
            <ToDoCompleted/>
            <ToDoEditing/>
            <ToDoView/>
        </ul>
    );
}

const ToDoCount = () => {
    return (
        <span>1 item left</span>
    );
};

const ToDoFilterCompleted = () => {
    return (
        <li>
            <button>Completed</button>
        </li>
    );
}
const ToDoFilterActive = () => {
    return (
        <li>
            <button>Active</button>
        </li>
    );
}
const ToDoFilterSelected = () => {
    return (
        <li>
            <button>Selected</button>
        </li>
    );
}
const ToDoFilter = ()=>{
    return (
        <ul>
            <ToDoFilterSelected/>
            <ToDoFilterActive/>
            <ToDoFilterCompleted/>
        </ul>
    );
}

const ToDoClear = () => {
    return (
        <button className="clear-completed">Clear completed</button>
    );
}

const ToDoFooter = () => {
    return (
        <footer>
            <ToDoCount/>
            <ToDoFilter/>
            <ToDoClear/>
        </footer>
    );
}
const ToDoMain = ()=>{
    return (
      <section>
          <ToDoList/>
          <ToDoFooter/>
      </section>
    );
}
const ToDoApp = () =>{
    return (
        <section>
            <ToDoHeader/>
            <ToDoMain/>
        </section>
    );
}
const app = <ToDoApp/>;
ReactDOM.render(app,  document.getElementById('root'))


